import React from 'react'
import style from "./Car.module.css"
const Car = ({source,name,price}) => {
    return (
        <div className={style.cars}>
            <img src={source} className={style.car}/>
            <h3 style={{color:"white" ,padding:"10px"}}>{name}</h3>
            <p style={{color:"white",padding:"10px"}}>{price}</p>
        </div>
    )
}

export default Car
